    "2016-07-27T22:29:19.715320",nt"name": "2004-rose-site-4p",nt"isopen":
    false,nt"url": null,nt"notes": "Underwater Site 4P was established off
    Rose Atoll, American Samoa by Dr. James Maragos, U.S. Fish & Wildlife Service, on
    February 9, 2004. With a start point (meter 0) at latitude 14 33.569S longitude
    168 09.617W, a series of metal stakes were pounded into the substrate to delineate
    a 51-meter line that could be relocated and reassessed on future surveys. A fiberglass
    tape was unrolled along the line marked by the stakes and a series of photographs
    was taken of the benthos in consecutive 1-meter-square (1m x 1m) quadrats, using
    an Olympus 5050Z digital camera in an underwater housing. The overall goal was to
    acquire data from the photographs and analyze and present quantitative data in a
    manner to be useful for scientists and refuge management. Each image is labeled
    with a 3-letter location code (ROS), date (9Feb04), site number (4P), and meter
    interval along the transect line (e.g., 5-6M).",nt"license_title": "License
